import React from "react";

import styles from "./Projects.module.css";

const Projects = () => {
  return (
    <div>
      <div>
        <h2>2021</h2>
        <h1>MyGuitarShop Web Application</h1>
        <p>
          In our two-person team, we developed a full stack web application
          using a combination of PHP, HTML, CSS, MySQL, and phpMyAdmin, which
          provided us with a robust platform for both front-end and back-end
          development. I was also responsible for integrating email
          functionality using the PHPMailer library, configuring it to send
          emails through Google's Gmail SMTP server.
        </p>
      </div>
    </div>
  );
};

export default Projects;
